import React, {Component} from 'react';
import {Route} from 'react-router-dom'
import './App.css';
import MainPage from './pages/main-page'

const AnotherPage = () => (
    <div>
        <h1>HHHH</h1>
    </div>
)

class App extends Component {
    constructor() {
        super();
    }

    render() {
        return (
            <div>
                <Route exact path='/' component={MainPage} />
            </div>
        )

    }
}

export default App;
